import React from 'react';

function CarList({ cars, pendingCars, onRegister, onEdit }) {
  const handleRegisterClick = (car, year, price) => {
    const updatedCar = { ...car, year, price };
    onRegister(updatedCar);
  };

  const handleEditClick = (car) => {
    onEdit(car);
  };

  return (
    <div>
      <h3>Registered Cars</h3>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Model</th>
            <th>Year</th>
            <th>Price</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {cars.map((car) => (
            <tr key={car.id}>
              <td>{car.name}</td>
              <td>{car.model}</td>
              <td>{car.year}</td>
              <td>{car.price}</td>
              <td>
                <button onClick={() => handleEditClick(car)}>Edit</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <h3>Pending Cars</h3>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Model</th>
            <th>Year</th>
            <th>Price</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {pendingCars.map((car, index) => {
            const yearInputId = `year-${index}`;
            const priceInputId = `price-${index}`;

            return (
              <tr key={index}>
                <td>{car.name}</td>
                <td>{car.model}</td>
                <td>
                  <input
                    type="number"
                    id={yearInputId}
                    placeholder="Year"
                  />
                </td>
                <td>
                  <input
                    type="number"
                    id={priceInputId}
                    placeholder="Price"
                  />
                </td>
                <td>
                  <button
                    onClick={() =>
                      handleRegisterClick(
                        car,
                        parseInt(document.getElementById(yearInputId).value, 10),
                        parseFloat(document.getElementById(priceInputId).value)
                      )
                    }
                  >
                    Register
                  </button>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}

export default CarList;
